import React, { Component } from 'react';
import {NavLink} from 'react-router-dom';



class Home extends Component {

    // constructor(props){
    //     super(props)
    //     this.state = {
    //         toggler: false
    //     }
    // }


    render() {
        return (

            <div>
                <div className="gifs__header_menu_item"><NavLink to="/species" className="gifs__header_menu_link">Species</NavLink></div>
                <div className="gifs__header_menu_item"><NavLink to="/people" className="gifs__header_menu_link">People</NavLink></div>
            </div>
        )
    }


}
export default Home
